          />
          <div>
            <p>Ï£ºÎ•ò Ïù¥Î¶Ñ: {resultData.drinkName}</p>
            <p>ÎèÑÏàò: {resultData.dosu}</p>
            <p>Í∞ÄÍ≤©: {resultData.price}</p>
          </div>
          <StyledList>
            <StyledListItem>
              <ListItemText primary={drinkInfo?.name} secondary="Ï£ºÎ•ò Ïù¥Î¶Ñ" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={drinkInfo?.dosu} secondary="ÎèÑÏàò" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={drinkInfo?.price} secondary="Í∞ÄÍ≤©" />
            </StyledListItem>
            <StyledListItem>
              <ListItemText primary={drinkInfo?.type} secondary="Ï¢ÖÎ•ò" />
            </StyledListItem>
          </StyledList>

          <S.Text>BeJuryuÏùò comment: {SAD_CONTENT}</S.Text>
        </S.WhiteBox>

        <S.BtnList>
          <S.SubmitButton onClick={handleFormSubmit}>
            Í≤∞Í≥º Í≥µÏú†ÌïòÍ∏∞
          </S.SubmitButton>
          <S.SubmitButton onClick={handleButtonClick}>
            Îã§Ïãú Ï∂îÏ≤úÎ∞õÍ∏∞
          </S.SubmitButton>
